import React from 'react';
import { List, ListItem, ListItemText } from '@mui/material';

const MessageBox = ({ messages }) => {
  return (
    <List>
      {messages.map((msg, index) => (
        <ListItem key={index}>
          <ListItemText primary={`${msg.username}: ${msg.message}`} />
        </ListItem>
      ))}
    </List>
  );
};

export default MessageBox;
